pub struct TowerClass {
    back: [u8; 40 * 120],
    contents: [u8; 40 * 700],
    minitower: [u8; 40 * 100],
    // vmult: [i32; 40 * 700],
    vmult: Vec<i32>,

    pub minitowermode: bool,
}

fn get (i: i32) -> i32 {
    i * 40
}

impl TowerClass {
    // towerclass(void);
    pub fn new () -> Self {
        //We init the lookup table:
        let mut vmult = vec![];
        for i in 0..(40*700) {
            vmult.push(i * 40);
        }

        let class = Self {
            //We create a blank map
            back: background,
            contents: [0; 40 * 700],
            minitower: [0; 40 * 100],
            vmult,

            minitowermode: false,
        };

        class
    }

    // int backat(int xp, int yp, int yoff);
    pub fn backat(&self, xp: i32, yp: i32, yoff: i32) -> u8 {
        let mut yp = yp * 8;
        yp += yoff;
        let yoff = yp % 8;
        yp = (yp - yoff) / 8;

        if xp >= 0 && xp < 40 {
            while yp < 0 {
                yp += 120;
            }
            while yp >= 120 {
                yp -= 120;
            }

            self.back[xp as usize + self.vmult[yp as usize] as usize]
        } else {
            0
        }
    }

    // int at(int xp, int yp, int yoff);
    pub fn at(&self, xp: i32, yp: i32, yoff: i32) -> i32 {
        if self.minitowermode {
            return self.miniat(xp, yp, yoff);
        } else {
            let mut yp = yp * 8;
            yp += yoff;
            let yoff = yp % 8;
            yp = (yp - yoff) / 8;

            while yp < 0 { yp += 700; }
            while yp >= 700 { yp -= 700; }
            if xp >= 0 && xp < 40 {
                return self.contents[(xp + self.vmult[yp as usize]) as usize] as i32;
            } else if xp == -1 {
                return self.contents[self.vmult[yp as usize] as usize] as i32;
            } else if xp == 40 {
                return self.contents[(39 + self.vmult[yp as usize]) as usize] as i32;
            }

            return 0;
        }
    }

    // int miniat(int xp, int yp, int yoff);
    fn miniat(&self, xp: i32, yp: i32, yoff: i32) -> i32 {
        let mut yp = yp * 8;
        yp += yoff;
        let yoff = yp % 8;
        yp = (yp - yoff) / 8;

        while yp < 0 { yp += 100; }
        while yp >= 100 { yp -= 100; }
        if xp >= 0 && xp < 40 {
            return self.minitower[xp as usize + self.vmult[yp as usize] as usize] as i32;
        }
        else if xp == -1 {
            return self.minitower[self.vmult[yp as usize] as usize] as i32;
        } else if xp == 40 {
            return self.minitower[39 + self.vmult[yp as usize] as usize] as i32;
        }

        0
    }

    // void loadminitower1(void);
    pub fn loadminitower1(&mut self) {
        self.minitower = minitower1;
    }

    // void loadminitower2(void);
    pub fn loadminitower2(&mut self) {
        self.minitower = minitower2;
    }

    // void loadbackground(void);
    pub fn loadbackground(&mut self) {
        self.back = background;
    }

    // void loadmap(void);
    pub fn loadmap(&mut self) {
        self.contents = map;
    }
}

